css:
@-moz-document url-prefix("http://"), url-prefix("https://"), url-prefix("ftp://"), url-prefix("file://") {
html {
  width: 100%;
  height: 100%;
}
body {
  background: url(data:image/png;base64,), linear-gradient(0deg,  #131d22, #436b69, #8d9a91);
  color: #131d22;
  font-family: monospace;
  width: 29em;
  margin: 0 auto;
  text-shadow: 0px -5px 5px rgba(255, 255, 255, 0.25);
  font-size: 10pt;
}
.spoiler {
  background: #131d22;
}
.spoiler:hover {
  background: transparent;
}
a { 
  color: #A1AEA5; 
}
}
